import React from 'react';
import './MyDate.css';

const MyDate = (props) => {
    console.log(props);
    return (
        <div>
             <div className="date">
                <div className="month">
                    四月
                </div>
                <div className="day">
                    19
                </div>
            </div> 
        </div>
    );
};

export default MyDate;
